export const data = {
  progams: [
    {
      id: 1,
      // 3 mins in ms
      rest_duration: 180000,
      name: "My Fave :)",
      days: [
        {
          id: 112,
          cardio: {
            name: "running",
            // 15 mins in ms
            duration: 900000,
          },
          workouts_needed: [
            {
              workout_name: ["Incline Bench Press"],
              goal: [
                {
                  weight: 120,
                  sets: 3,
                  min_reps: 6,
                  max_reps: 8,
                },
              ],
              muscles_worked: ["chest"],
            },
            {
              workout_name: ["Neutral Bench Press"],
              goal: [
                {
                  weight: 160,
                  sets: 3,
                  min_reps: 6,
                  max_reps: 8,
                },
              ],
              muscles_worked: ["chest"],
            },
            {
              workout_name: ["Cable Upper Back Pulldown"],
              goal: [
                {
                  weight: 140,
                  sets: 3,
                  min_reps: 6,
                  max_reps: 8,
                },
              ],
              muscles_worked: ["Back"],
            },
            {
              workout_name: ["Lat Row"],
              goal: [
                {
                  weight: 142,
                  sets: 3,
                  min_reps: 6,
                  max_reps: 8,
                },
              ],
              muscles_worked: ["Lats"],
            },
            {
              workout_name: ["Shoulder Press - front"],
              goal: [
                {
                  weight: 55,
                  sets: 2,
                  min_reps: 5,
                  max_reps: 8,
                },
              ],
              muscles_worked: ["front shoulder"],
            },
          ],
        },
        // arms
        {
          id: 113,
          cardio: {
            name: "incline treadmill",
            // 10 mins in ms
            duration: 600000,
          },
          workouts_needed: [
            {
              workout_name: [
                "double crossbody tricep extension",
                "single tricep push down",
              ],
              goal: [
                {
                  weight: 27.5,
                  sets: 3,
                  min_reps: 6,
                  max_reps: 8,
                },
                {
                  weight: 27.5,
                  sets: 3,
                  min_reps: 6,
                  max_reps: 8,
                },
              ],
              muscles_worked: ["tricep", "tricep"],
            },
            {
              workout_name: ["Cable faceaway bicep curl"],
              goal: [
                {
                  sets: 3,
                  min_reps: 6,
                  max_reps: 9,
                },
              ],
              muscles_worked: ["long head - bicep"],
            },
            {
              workout_name: ["Dumbbell hammer curl"],
              goal: [
                {
                  sets: 3,
                  min_reps: 6,
                  max_reps: 8,
                },
              ],
              muscles_worked: ["bicep"],
            },
            {
              workout_name: ["Spider curl machine"],
              goal: [
                {
                  sets: 2,
                  min_reps: 6,
                  max_reps: 8,
                },
              ],
              muscles_worked: ["short head - bicep"],
            },
            {
              workout_name: ["rear delt cable fly"],
              goal: [
                {
                  sets: 3,
                  min_reps: 6,
                  max_reps: 9,
                },
              ],
              muscles_worked: ["back shoulder"],
            },
          ],
        },
      ],
    },
  ],
};
